{
  "meta": { "grid_unit": "10x10", "origin": "R1.position" },

  "robots": [
    { "id": "R1", "position": [0, 0], "max_reach": 15, "work_angles": [270, 180] }
  ],

  "equipments": [
    { "id": "M1", "type": "machine", "center": [-8, 10], "size": [14, 8], "orientation": "up" },
    { "id": "M2", "type": "machine", "center": [12, 3],  "size": [8, 12],  "orientation": "right" },

    /* 접근 가능 영역(설비 외측 전면) */
    { "id": "M1A1", "type": "access_area", "center": [-8, 4],  "size": [10, 3]  },
    { "id": "M2A1", "type": "access_area", "center": [18, 3],  "size": [3, 8]   }
  ],

  "conveyors": [
    { "id": "C1", "center": [0, -28], "size": [8, 40], "direction": "Y", "shape": "rect" }
  ],

  "fences": [
    { "id": "F1", "shape": "rect", "center": [30, 5], "size": [70, 53] }
  ],

  "tasks": [
    { "order": 1, "actor": "R1", "action": "픽업", "from": "C1",
      "pick_area": { "center": [0, -8], "size": [6, 6] } },

    { "order": 2, "actor": "R1", "action": "이송", "from": "C1", "to": "M1A1" },
    { "order": 3, "actor": "R1", "action": "삽입", "via": "M1A1", "to": "M1" },

    { "order": 4, "actor": "R1", "action": "픽업", "from": "C1",
      "pick_area": { "center": [0, -8], "size": [6, 6] } },

    { "order": 5, "actor": "R1", "action": "이송", "from": "C1", "to": "M2A1" },
    { "order": 6, "actor": "R1", "action": "삽입", "via": "M2A1", "to": "M2" }
  ],

  "task_loop": {
    "repeat": true,
    "pattern": ["M1A1→M1", "M2A1→M2"],
    "description": "C1 픽업 → M1A1을 통해 M1 삽입 → C1 픽업 → M2A1을 통해 M2 삽입을 반복"
  }
}

{
  "meta": { "grid_unit": "10x10", "origin": "R1.position" },

  "robots": [
    { "id": "R1", "position": [0, 0],   "max_reach": 12, “work sectors” : [(0.0,12.0), (78.0,102.0), (170.3,194.3), (261.6,285.6), (348.0,360.0)] },
    { "id": "R2", "position": [0, -32], "max_reach": 12, “work sectors” : [(0.0,12.0), (58.2,82.2), (162.2,186.2), (258.0,282.0), (348.0,360.0)] }
  ],

  "conveyors": [
    { "id": "C2", "center": [0, -17],  "size": [3, 25], "direction": "Y", "shape": "rect" },
    { "id": "C1", "center": [20, 0],   "size": [16, 3], "direction": "X", "shape": "rect" },
    { "id": "C3", "center": [20, -32], "size": [16, 3], "direction": "X", "shape": "rect" }
  ],

  "equipments": [
    { "id": "M1_white", "type": "machine", "center": [0, 8],   "size": [12, 8]  },
    { "id": "M2_white", "type": "machine", "center": [-8, -2], "size": [12, 8]  },
    { "id": "M3_black", "type": "machine", "center": [-8, -32], "size": [10, 8] },
    { "id": "M4_black", "type": "machine", "center": [5, -41],  "size": [10, 8] }
  ],

  "access_areas": [
    /* M1 south-side access: width 10, height 2, flush inside the south edge */
    { "id": "M1A1", "attached_to": "M1_white", "edge": "south", "center": [0, 5],   "size": [10, 2] },

    /* M2 east-side access: width 2, height 6, flush inside the east edge */
    { "id": "M2A1", "attached_to": "M2_white", "edge": "east",  "center": [-3, -2], "size": [2, 6] },

    /* M3 east-side access: width 2, height 6, flush inside the east edge */
    { "id": "M3A1", "attached_to": "M3_black", "edge": "east",  "center": [-4, -32], "size": [2, 6] },

    /* M4 west-side access: width 2, height 6, flush inside the west edge */
    { "id": "M4A1", "attached_to": "M4_black", "edge": "west",  "center": [4, -38], "size": [2, 6] }
  ],

  "fences": [
    { "id": "F1", "shape": "rect", "center": [0, 0],   "size": [28, 24] },
    { "id": "F2", "shape": "rect", "center": [0, -32], "size": [28, 24] }
  ],

  "work_sequences": [
    {
      "product": "product1",
      "concurrency": "parallel",
      "sequence": [
        { "order": 1, "actor": "R1", "action": "픽업", "from": "C1" },
        { "order": 2, "actor": "R1", "action": "삽입", "via": "M1A1", "to": "M1_white" },
        { "order": 3, "actor": "M1_white", "action": "가공", "at": "M1_white" },
        { "order": 4, "actor": "R1", "action": "언로딩", "from": "M1_white", "to": "C2" },
        { "order": 5, "actor": "R2", "action": "픽업", "from": "C2" },
        { "order": 6, "actor": "R2", "action": "삽입", "via": "M3A1", "to": "M3_black" },
        { "order": 7, "actor": "M3_black", "action": "가공", "at": "M3_black" },
        { "order": 8, "actor": "R2", "action": "언로딩", "from": "M3_black", "to": "C3" }
      ]
    },
    {
      "product": "product2",
      "concurrency": "parallel",
      "sequence": [
        { "order": 1, "actor": "R1", "action": "픽업", "from": "C1" },
        { "order": 2, "actor": "R1", "action": "삽입", "via": "M2A1", "to": "M2_white" },
        { "order": 3, "actor": "M2_white", "action": "가공", "at": "M2_white" },
        { "order": 4, "actor": "R1", "action": "언로딩", "from": "M2_white", "to": "C2" },
        { "order": 5, "actor": "R2", "action": "픽업", "from": "C2" },
        { "order": 6, "actor": "R2", "action": "삽입", "via": "M4A1", "to": "M4_black" },
        { "order": 7, "actor": "M4_black", "action": "가공", "at": "M4_black" },
        { "order": 8, "actor": "R2", "action": "언로딩", "from": "M4_black", "to": "C3" }
      ]
    }
  ]
}
